import React, { useEffect } from 'react';
import "./header.css"
import $ from 'jquery';
import ReactLive2d from 'react-live2d';

function Header() {
    useEffect(() => {
        function loadModule() {
            // $(document).ready(function() {
            //     headerShadow();
            // });
        }

        function headerShadow() {
            var header = $('header');

            $(window).scroll(function(e){
                if(header.offset().top > 0){
                    if(!header.hasclass('shadow')){
                        header.addclass('shadow');
                    }
                }else{
                    header.removeclass('shadow');
                }
            });
        }

        loadModule();

    }, []);

    return (
        <div className="header">
            <meta charSet="UTF-8" />
            <meta name="viewport" content="width=device-width, initial-scale=1.0" />
            <link href='https://fonts.googleapis.com/css?family=Open Sans' rel='stylesheet' />
            <link rel="icon" href="/static/images/BinLTools_logo.ico" type="image/x-icon" />
            <link rel="preconnect" href="https://fonts.googleapis.com" />
            <link rel="preconnect" href="https://fonts.gstatic.com" crossOrigin="true" />
            <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@100;400&display=swap" rel="stylesheet" />
            <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@100;400;700&display=swap" rel="stylesheet" />
            <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@100;400;500;700&display=swap" rel="stylesheet" />
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.3/css/all.min.css" />
            <link rel="stylesheet" herf="style.css" />
            <link rel="stylesheet" href="/static/css/live2d.css" />

            {/* Live2DCubismCore */}
            {/* <script src="https://cubism.live2d.com/sdk-web/cubismcore/live2dcubismcore.min.js"></script> */}

            {/* Include Pixi */}
            {/* <script src="../../components/live2dWigit/frame/pixi.min.js"></script> */}

            {/* Include Cubism Components */}
            {/* <script src='../../components/live2dWigit/live2dcubismframework.js'></script>
            <script src='../../components/live2dWigit/live2dcubismpixi.js'></script> */}

            {/* User's Script */}
            {/* <script src="../../components/live2dWigit/l2d.js"></script> */}

            <header>
                <div className="container">
                    <div id="branding">
                        <h1><a id="header_logo" href="/"><span className="highlight">BinL</span>Tools</a></h1>
                    </div>
                    <nav>
                        <ul>
                            <li><a href="/about_me">About Me</a></li>
                            <li><a href="https://github.com/BinL233">GitHub</a></li>
                            {/* TODO: Need to link to backend */}
                            <li><a href="/login"></a></li>
                        </ul>
                    </nav>
                </div>
            </header>
            <div>
                <ReactLive2d
                    width={350}
                    height={450}
                    right={100}
                    ModelList = {['Domino']}
                />
            </div>
        </div>
    )
}

export default Header;
